import React, { Component } from 'react';

class AddEmployeeComponents extends Component {
    constructor(props){
        super(props)
        this.state={
            cus_full_name:'',
            cus_nic_number:'',
            cusdob:''

        }
    }
    changeDateHandlter=(event)=>{
this.setState({
    cusdob:event.target.value
});
    }
    render() {
        return (
            <div>
                   <div>
                <div className="content-wrapper">
                    {/* Content Header (Page header) */}
                    <div className="content-header">
                        <div className="container-fluid">
                            <div className="row mb-2">
                                <div className="col-sm-6">
                                    <h4>Employye list</h4>
                                </div>{/* /.col */}
                                <div className="col-sm-6">
                                    <ol className="breadcrumb float-sm-right">
                                        <li className="breadcrumb-item"><a href="#">Home</a></li>
                                        <li className="breadcrumb-item active">Dashboard v2</li>
                                    </ol>


                                </div>{/* /.col */}
                            </div>{/* /.row */}
                        </div>{/* /.container-fluid */}
                    </div>

                    <section className="content">
                        <div className="container-fluid">
                            {/* Info boxes */}





                            <div className="row">
                                {/* left column */}
                                <div className="col-md-6">
                                    {/* general form elements */}
                                    <div className="card card-default">
                                        <div className="card-header">
                                            <h3 className="card-title">Quick Example</h3>
                                        </div>
                                        {/* /.card-header */}
                                        {/* form start */}
                                        <form role="form">
                                            <div className="card-body">
                                                <div className="form-group">
                                                    <label htmlFor="exampleInputEmail1">Customer Name</label>
                                                    <input type="text" className="form-control" id="cus_full_name" placeholder="Enter Full name" value={this.state.cus_full_name}/>
                                                </div>
                                                <div className="form-group">
                                                    <label htmlFor="exampleInputEmail1">NIC Number</label>
                                                    <input type="text" className="form-control" id="cus_nic_number" placeholder="Enter NIC number" value={this.state.cus_nic_number}/>
                                                </div>
                                                <div className="form-group">
                                                    <label htmlFor="exampleInputEmail1">Date of birth</label>
                                                    <input type="date" className="form-control" id="cusdob"  value={this.state.cusdob} onChange={this.changeDateHandlter}/>
                                                </div>
                                               


                                            </div>
                                            {/* /.card-body */}
                                           
                                        </form>
                                    </div>


                                </div>
                                {/*/.col (left) */}
                                {/* right column */}
                                <div className="col-md-6">
                                    {/* general form elements disabled */}
                                    <div className="card card-default">
                                        <div className="card-header">
                                            <h3 className="card-title">General Elements</h3>
                                        </div>
                                        {/* /.card-header */}
                                        <div className="card-body">
                                            <form role="form">

                                                <div className="form-group">
                                                    <label htmlFor="exampleInputEmail1">Email address</label>
                                                    <input type="email" className="form-control" id="exampleInputEmail1" placeholder="Enter email" />
                                                </div>
                                                <div className="form-group">
                                                    <label htmlFor="exampleInputPassword1">Password</label>
                                                    <input type="password" className="form-control" id="exampleInputPassword1" placeholder="Password" />
                                                </div>




                                            </form>
                                        </div>
                                        {/* /.card-body */}
                                    </div>
                                    {/* /.card */}
                                    {/* general form elements disabled */}

                                </div>
                                {/*/.col (right) */}
                            </div>

                            {/* <div className="card-footer"> */}
                                                <button type="submit" className="btn btn-primary">Submit</button>
                                                
                                            {/* </div> */}







                        </div>
                    </section>
                </div>

            </div>
            </div>
        );
    }
}

export default AddEmployeeComponents;
